import React from "react";
import { render } from "react-dom";
import App from "./App";
import { BrowserRouter } from "react-router-dom";
import reportWebVitals from "./reportWebVitals";
import NavButtons from './Component/Layout/NavButtons';

const rootElement = document.getElementById("root");

render(
    <BrowserRouter>
        <Routes>
            <Route exact path='/' element={<App />} />
            <Route exact path='/login' element={<Login />} />
            <Route exact path='/register' element={<Register />} />
            <Routes>
                <SecureRoute exact path='/loginsuccess' element={<NavButtons />} />
                <SecureRoute exact path='/random' element={<RandomQuote />} />
                <SecureRoute exact path='/category' element={<SelectVariants />} />
                <SecureRoute exact path='/author' element={<AuthorSelect />} />
            </Routes>
        </Routes>
    </BrowserRouter>,
    rootElement
);
reportWebVitals(console.log);
